import React from 'react';
import Box from '@mui/material/Box';

const FreshworksForm = () => {
  return (
    <Box width="100%" height="500px">
      <iframe
        src="https://northernlionlabs.myfreshworks.com/crm/sales/web_forms/878096a47237ef12a6f963047c297e7e09645dcba8490d9b0e631e7eab0e9385"
        width="100%"
        height="100%"
        frameBorder="0"
        scrolling="no"
        title="Freshworks Form"
      />
    </Box>
  );
};

export default FreshworksForm;
